function generate1($gex) {
	//exec( $gex, $output);
	$mode = ' -noseed';
	$gex = $gex.$mode.' out.txt';
	//echo $gex;
	exec($gex);
	//echo '<br />'.$output.'<br />';
}
function qrGen($data,$title)
{
	echo '<br />'.'<img src="https://chart.googleapis.com/chart?chs=150x150&cht=qr&chl='.$data.'&choe=UTF-8" title='.$title.' />'.'<br />';
}

function show() {
	$fh = fopen('out.txt','r');
	$i=0;
	while ($line = fgets($fh)) {
		//echo($line);
		$pos = strpos($line, ':');
		$data = substr($line, $pos+1);
		$title = substr($line,0,$pos);
		if($i < 2)
			qrGen($data,$title);
		$i++;
		if($i == 3)
		echo '<br />';
		echo $title.' : '.$data.'<br />';
	}
	
	fclose($fh);
}


function delOut() {
	unlink('out.txt');
}

$genex ="decgen.exe"; //Exe file that generates the Decred Address


if(isset($_REQUEST['Generate']))
{
//delOut();
	if(strcmp($_GET['Generate'], 'Single Address') === 0)
	{
		generate1($genex);
		show();
		delOut();
	}

}
